import { Jumbotron } from "react-bootstrap";

const Note = ({ name }) => {
  return (
    <Jumbotron className={name}>
      <p className="note-content">
        Katalog spraw w czytelny sposób prezentuje sprawy urzędowe jakie mogą
        Cię zainteresować. Znajdź swoją sprawę i zapoznaj się z jej szczegółami.
      </p>
    </Jumbotron>
  );
};

export default Note;
